Anyway. About this upload: This feels a bit strange.
I actually wrote the songs for and recorded this CD nearly 10 years ago. And today I got to thinking: Maybe I could upload it as a torrent? Somebody might even download it, and perhaps even like it..?

I don't know. What I do know, is that even though my knowledge of the English language probably could be better, I did my best, and I did it with a willing heart. Hence the name of the record.

I'm of course not doing this to promote myself. If any name is promoted through this music, I hope and pray it must be the Name of Jesus of Nazareth..

So, without further excuses or adornments i humbly present it to you like it is.

